"use strict";(self.webpackChunkeclipse_tractusx_github_io=self.webpackChunkeclipse_tractusx_github_io||[]).push([[11477],{30010:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"new-release-2403","metadata":{"permalink":"/blog/new-release-2403","editUrl":"https://github.com/eclipse-tractusx/eclipse-tractusx.github.io/tree/main/blog/2024-03-08-release-24-03.md","source":"@site/blog/2024-03-08-release-24-03.md","title":"Tractus-X 24.03 available now","description":"Release Tractus-X 24.03 announcement","date":"2024-03-08T11:00:00.000Z","formattedDate":"March 8, 2024","tags":[],"readingTime":0.675,"hasTruncateMarker":false,"authors":[{"name":"Maximilian Ong","title":"Ecosystem & Kits","url":"https://github.com/maximilianong","image_url":"https://github.com/maximilianong.png","email":"maximilian.ong@catena-x.net","imageURL":"https://github.com/maximilianong.png"}],"frontMatter":{"title":"Tractus-X 24.03 available now","description":"Release Tractus-X 24.03 announcement","slug":"new-release-2403","date":"2024-03-08T11:00","hide_table_of_contents":false,"authors":[{"name":"Maximilian Ong","title":"Ecosystem & Kits","url":"https://github.com/maximilianong","image_url":"https://github.com/maximilianong.png","email":"maximilian.ong@catena-x.net","imageURL":"https://github.com/maximilianong.png"}]},"nextItem":{"title":"Second Eclipse Tractus-X Community Days","permalink":"/blog/community-days-05-2024"}},"content":"![Release Image](@site/static/img/Tractus-X_Release24.03.png)\\n\\nWe are pleased to announce our first minor release in 2024!\\n\\nTractus-X Release 24.03 focuses on improving the performance and stability of our Catena-X core and onboard services, strengthening our data space foundation.\\n\\nUse Cases & Value Creation: With five new KITs we are introducing exciting new offerings to solve the toughest industry problems such as company certificate management, data governance, manufacturing as a service, environmental & social standards (ESS).\\n\\nThe Industry Core is an integrative layer between the industry-agnostic dataspace foundation and the use cases. It ensures that the various applications can access common functionalities. It describes how digital twins of components, materials and vehicles can be created for the automotive industry and linked with direct business partners. \\n\\nData Space Governance: The Catena-X Automotive Network e.V. will provide the corresponding standards (https://catena-x.net/de/standard-library)."},{"id":"community-days-05-2024","metadata":{"permalink":"/blog/community-days-05-2024","editUrl":"https://github.com/eclipse-tractusx/eclipse-tractusx.github.io/tree/main/blog/2024-05-16-community-days.mdx","source":"@site/blog/2024-05-16-community-days.mdx","title":"Second Eclipse Tractus-X Community Days","description":"The Eclipse Tractus-X Community Days - Empowering the Catena-X Data Space","date":"2024-02-19T13:00:00.000Z","formattedDate":"February 19, 2024","tags":[],"readingTime":2.34,"hasTruncateMarker":true,"authors":[{"name":"Stephan Bauer","title":"Platform Domain Manager","url":"https://github.com/stephanbcbauer","image_url":"https://github.com/stephanbcbauer.png","email":"stephan.bauer@catena-x.net","imageURL":"https://github.com/stephanbcbauer.png"}],"frontMatter":{"title":"Second Eclipse Tractus-X Community Days","description":"The Eclipse Tractus-X Community Days - Empowering the Catena-X Data Space","slug":"community-days-05-2024","date":"2024-02-19T13:00","hide_table_of_contents":false,"authors":[{"name":"Stephan Bauer","title":"Platform Domain Manager","url":"https://github.com/stephanbcbauer","image_url":"https://github.com/stephanbcbauer.png","email":"stephan.bauer@catena-x.net","imageURL":"https://github.com/stephanbcbauer.png"}]},"prevItem":{"title":"Tractus-X 24.03 available now","permalink":"/blog/new-release-2403"},"nextItem":{"title":"Tractus-X Open Planning R24.08","permalink":"/blog/open-planning-r24-08"}},"content":"import RenderImage from \'./RenderImage\'\\n\\n![eclipse tractus x logo](@site/static/img/Tractus-X_Community_Days_24-05.png)\\n\\nDear Tractus-X- and Dataspace-Community,\\n\\n**After the great success of our event in December 2023, we are pleased to invite you to the second edition: the Second Eclipse Tractus-X Community Days on May 16 and 17, 2024,\\nagain in the inspiring and collaborative atmosphere of ARENA2036 in Stuttgart!**\\n\\n\x3c!--truncate--\x3e\\n\\n### Why you should be there\\n\\nAt the follow-up event, we will once again offer you the opportunity to meet the developer community live, actively engage with our Tractus-X IT tools and exchange ideas with technical\\nexperts. Gain deep insights into open-source reference implementations and KITs in the Tractus-X project as well as into the technology of sovereign data exchange and actively contribute\\nyour ideas in practical hands-on workshops (e.g. for use cases).\\n\\n### What you can expect\\n\\nYou can look forward to keynote speeches with highly interesting insights, short deep dives for a practical introduction to open-source topics and, in the main, workshops and hands-on sessions\\nin which you can get active and code on Tractus-X yourself with our support.\\n\\nOnce again, a community party awaits you on the first evening for networking and talking shop with delicious food and an entertaining program.\\n\\nThe Eclipse Tractus-X Community Days start on Thursday at 12 noon and end on Friday at around 4 p.m.\\n\\n![eclipse tractus x logo](@site/static/img/second-eclipse-tractus-x-community-Days-agenda-1.png)\\n![eclipse tractus x logo](@site/static/img/second-eclipse-tractus-x-community-Days-agenda-2.png)\\n\\n:::note\\n\\nImpressions of the start of the event series in December 2023 can be found in photos, reports and documents here at [ARENA2036.de](https://arena2036.de/en/projects/arena-x/first-eclipse-tractus-x-community-days-7th-8th-december)\\nand [Catena-X.net](https://catena-x.net/en/news-dates/artikel/first-tractus-x-community-days).\\n\\n:::\\n\\n### Who is the event suitable for\\n\\nWith the support of experts and in exchange with like-minded people, developers can actively test the possibilities of Tractus-X and the KITs. Of course, other technology enthusiasts with an interest in sovereign data exchange are also welcome:\\n- Developers who use Tractus-X or would like to contribute to it\\n- Service or solution providers who would like to participate in the Catena-X ecosystem\\n- Data providers who want to provide data in the right format and with the right semantics\\n- Product planning and development managers (product owners or product managers) who want to learn how to plan in open source projects\\n\\n### How you can participate\\n\\n:::info\\n\\nRegister for free via [eveeno](https://eveeno.com/tractus-x-community-days). The number of participants is limited, so secure your place quickly!\\n\\n:::\\n\\nIf you have any questions about the event, please contact Heike Wohlfeld at [heike.wohlfeld@arena2036.de](heike.wohlfeld@arena2036.de).\\n\\nWe look forward to welcoming you to this exciting event and exploring the possibilities of Tractus-X and the Catena-X KITs together!\\n\\n### Presenters of the event\\n\\nThis is an Eclipse Tractus-X event, which takes place within the framework of the Catena-X Automotive Network consortium project (funding code: 13IK004*) and the Catena-X Automotive Network e.V. ARENA2036 will host the event on its premises and contribute its data space activities (ARENA-X)."},{"id":"open-planning-r24-08","metadata":{"permalink":"/blog/open-planning-r24-08","editUrl":"https://github.com/eclipse-tractusx/eclipse-tractusx.github.io/tree/main/blog/2024-04-10-open-planning-r24.08.mdx","source":"@site/blog/2024-04-10-open-planning-r24.08.mdx","title":"Tractus-X Open Planning R24.08","description":"The Eclipse Tractus-X Open Planning Days - Empowering the Catena-X Data Space","date":"2024-02-19T11:00:00.000Z","formattedDate":"February 19, 2024","tags":[],"readingTime":3.64,"hasTruncateMarker":true,"authors":[{"name":"Stephan Bauer","title":"Platform Domain Manager","url":"https://github.com/stephanbcbauer","image_url":"https://github.com/stephanbcbauer.png","email":"stephan.bauer@catena-x.net","imageURL":"https://github.com/stephanbcbauer.png"}],"frontMatter":{"title":"Tractus-X Open Planning R24.08","description":"The Eclipse Tractus-X Open Planning Days - Empowering the Catena-X Data Space","slug":"open-planning-r24-08","date":"2024-02-19T11:00","hide_table_of_contents":false,"authors":[{"name":"Stephan Bauer","title":"Platform Domain Manager","url":"https://github.com/stephanbcbauer","image_url":"https://github.com/stephanbcbauer.png","email":"stephan.bauer@catena-x.net","imageURL":"https://github.com/stephanbcbauer.png"}]},"prevItem":{"title":"Second Eclipse Tractus-X Community Days","permalink":"/blog/community-days-05-2024"},"nextItem":{"title":"Open Source Planning for Tractus-X release 24.05","permalink":"/blog/open-planning-days-pi12"}},"content":"![eclipse tractus x logo](@site/static/img/Tractus-X_openplanning.png)\\n\\nDear Tractus-X Community Members \ud83c\udf89,\\n\\nwe are excited to extend this invitation to you for our upcoming Tractus-X meetings. These meetings are a great opportunity for both business stakeholders and developers to contribute and collaborate on the future of Tractus-X.\\nPlease feel free to forward this post to anyone interested in contributing, whether in planning or development.\\n\\n## Agenda\\n\\n- **Date:** 10th April and 11th April 2024\\n- **Time:** 08:00 - 12:00\\n- Please see the [Open Meetings page](https://eclipse-tractusx.github.io/community/open-meetings) for downloadable ICS file and session link\\n- [Release Planning Board](https://github.com/orgs/eclipse-tractusx/projects/26/views/23)\\n\\n\x3c!--truncate--\x3e\\n\\n### Wednesday, 10th April 2024\\n\\n- **08:00 - 08:30** - Open Planning Vision & Intro\\n- **08:30 - 09:00** - Open Planning Vision Deep Dive Tractus-X\\n- **09:00 - 11:30** - Joint Open Planning (all teams)\\n  - **09:00 - 09:15** - Business Domain SUS\\n  - **09:15 - 11:15** - Platform Domain\\n  - **11:15 - 11:30** - Business Domain PQR\\n- **11:30 - 12:00** - Open Planning Wrap-Up / Summary Day 1\\n\\n:::info\\nThe detailed agenda is only filtered by `label`not by status. As a prequisite, the issues need to be in status `Backlog`.\\n:::\\n\\n#### Business Domain SUS\\n\\n| Time | Topic / Labels | Link | Number of features |\\n| ---- | ----- | ------------- | ---- |\\n| 09:00 - 09:10 | pcf, circularity, eco pass | [features](https://github.com/eclipse-tractusx/sig-release/issues?q=is%3Aissue+is%3Aopen+issue%3A+628+591+632+638+614) | 5 |\\n| 09:10 - 09:15 | digital product pass | [features](https://github.com/orgs/eclipse-tractusx/projects/26/views/23?filterQuery=label%3A%22Prep-PI13%22+label%3A%22digital+product+pass%22&pane=issue&itemId=59170648) | 4 |\\n\\n#### Platform Domain\\n\\n| Time | Topic / Labels | Link | Number of features |\\n| ---- | ----- | ------------- | ---- |\\n| 09:15 - 09:35 | golden record, business partner | [features](https://github.com/orgs/eclipse-tractusx/projects/26/views/23?filterQuery=label%3A%22Prep-PI13%22+label%3A%22golden+record%22%2C%22business+partner%22) | 7 |\\n| 09:35 - 09:55 | portal | [features](https://github.com/orgs/eclipse-tractusx/projects/26/views/23?filterQuery=label%3A%22Prep-PI13%22++label%3A%22portal%22+) | 8 |\\n| 10:35 - 10:40 | data sovereignty | [features](https://github.com/eclipse-tractusx/sig-release/issues?q=is%3Aissue+is%3Aopen+issue%3A+584+583+581) | 3 |\\n| 10:40 - 10:50 | digital twin registry, discovery finder, discovery service, semantic hub | [features](https://github.com/orgs/eclipse-tractusx/projects/26/views/23?filterQuery=label%3A%22Prep-PI13%22+label%3A%22digital+twin+registry%22%2C%22discovery+finder%22%2C%22discovery+service%22%2C%22semantic+hub%22) | 4 |\\n| 10:50 - 10:55 | knowledge agent | [features](https://github.com/orgs/eclipse-tractusx/projects/26/views/23?filterQuery=label%3A%22Prep-PI13%22+label%3A%22knowledge+agent%22+) | 2 |\\n\\n\\n#### Business Domain PQR\\n\\n| Time | Topic / Labels | Link | Number of features |\\n| ---- | ----- | ------------- | ---- |\\n| 11:15 - 11:30 | dcm, puris, osim | [features](https://github.com/orgs/eclipse-tractusx/projects/26/views/23?filterQuery=label%3A%22Prep-PI13%22+label%3A%22osim%22%2C%22puris%22%2C%22dcm%22+) | 8 |\\n\\n### Thursday, 11th April 2024\\n\\n- **08:00 - 09:00** - Open Planning Draft Plan Review\\n- **09:00 - 10:30** - Joint Open Planning (all teams)\\n- **10:30 - 11:00** - Release 24.08 Confidence Vote\\n- **11:00 - 11:30** - Feedback / Retro\\n- **11:30 - 12:00** - Open Planning Wrap-Up / Summary\\n\\n#### Platform Domain\\n\\n| Time | Topic / Labels | Link | Number of features |\\n| ---- | ----- | ------------- | ---- |\\n| 09:00 - 09:15 | miw | [features](https://github.com/orgs/eclipse-tractusx/projects/26/views/23?filterQuery=label%3A%22Prep-PI13%22+label%3A%22miw%22) | 3 |\\n| 09:15 - 09:30 | edc | [features](https://github.com/orgs/eclipse-tractusx/projects/26/views/23?filterQuery=label%3A%22Prep-PI13%22+label%3A%22edc%22) | 15 |\\n| 09:30 - 09:35 | sde | [features](https://github.com/orgs/eclipse-tractusx/projects/26/views/23?filterQuery=label%3A%22Prep-PI13%22+label%3A%22sde%22) | 1 |\\n| 09:35 - 09:45 | sd factory | [features](https://github.com/orgs/eclipse-tractusx/projects/26/views/23?filterQuery=label%3A%22Prep-PI13%22+label%3A%22sd+factory%22) | 2 |\\n| 09:45 - 09:55 | irs | [features](https://github.com/orgs/eclipse-tractusx/projects/26/views/23?filterQuery=label%3A%22Prep-PI13%22+label%3A%22irs%22) | 1 |\\n| 09:45 - 09:55 | trace-x | [features](https://github.com/orgs/eclipse-tractusx/projects/26/views/23?filterQuery=label%3A%22Prep-PI13%22+label%3A%22trace-x%22+) | 4 |\\n\\n#### Business Domain PQR\\n\\n| Time | Topic / Labels | Link | Number of features |\\n| ---- | ----- | ------------- | ---- |\\n| 09:55 - 10:15 | dcm, puris, osim | [features](https://github.com/orgs/eclipse-tractusx/projects/26/views/23?filterQuery=label%3A%22Prep-PI13%22+label%3A%22osim%22%2C%22puris%22%2C%22dcm%22+) | 8 |\\n\\n#### Left over\\n\\n| Time | Topic / Labels | Link | Number of features |\\n| ---- | ----- | ------------- | ---- |\\n| 10:15 - 10:30 | open decision  | [features](https://github.com/orgs/eclipse-tractusx/projects/26/views/23?sliceBy%5Bvalue%5D=open+decision) | 7 |\\n\\n## Staying Informed\\n\\nTo stay updated on any changes or additional information, please subscribe to our mailing list. A great way to keep informed is through the provided [Tractus-X Development Mailing List RSS Feed](https://www.eclipse.org/lists/tractusx-dev/maillist.rss).\\n\\n:::tip\\n\\nHere, you can also find previous messages for reference.\\n\\n:::\\n\\n## Further Information\\n\\nFor more details about the planning process and what these meetings entail, please refer to our guide on [Open Refinement and Planning in Open Source Communities](https://github.com/eclipse-tractusx/sig-release/blob/main/docs/open-refinement-and-planning.md)\\n and of course the sig-release [README](https://github.com/eclipse-tractusx/sig-release/blob/main/README.md)\\n\\n## Stay Connected\\n\\nFollow our [news section](https://eclipse-tractusx.github.io/blog) and join our [Tractus-X mailing list](https://eclipse-tractusx.github.io/docs/oss/how-to-contribute/#dev-mailinglist)\\nand be part of our [Matrix Chat from Eclipse Tractus-X](https://chat.eclipse.org/#/room/#tools.tractus-x:matrix.eclipse.org)\\n\\nFor more details about Tractus-X, visit the official [Eclipse Tractus-X Project Page](https://projects.eclipse.org/projects/automotive.tractusx).\\n\\n---\\n\\nWe look forward to your participation and contributions in shaping the future of Tractus-X.\\n\\n\ud83d\ude80 **The Tractus-X Team**"},{"id":"open-planning-days-pi12","metadata":{"permalink":"/blog/open-planning-days-pi12","editUrl":"https://github.com/eclipse-tractusx/eclipse-tractusx.github.io/tree/main/blog/2024-01-10-open-planning.mdx","source":"@site/blog/2024-01-10-open-planning.mdx","title":"Open Source Planning for Tractus-X release 24.05","description":"The Eclipse Tractus-X Open Planning Days - Empowering the Catena-X Data Space","date":"2023-12-11T21:51:00.000Z","formattedDate":"December 11, 2023","tags":[],"readingTime":1.525,"hasTruncateMarker":true,"authors":[{"name":"Stephan Bauer","title":"Platform Domain Manager","url":"https://github.com/stephanbcbauer","image_url":"https://github.com/stephanbcbauer.png","email":"stephan.bauer@catena-x.net","imageURL":"https://github.com/stephanbcbauer.png"}],"frontMatter":{"title":"Open Source Planning for Tractus-X release 24.05","description":"The Eclipse Tractus-X Open Planning Days - Empowering the Catena-X Data Space","slug":"open-planning-days-pi12","date":"2023-12-11T21:51","hide_table_of_contents":false,"authors":[{"name":"Stephan Bauer","title":"Platform Domain Manager","url":"https://github.com/stephanbcbauer","image_url":"https://github.com/stephanbcbauer.png","email":"stephan.bauer@catena-x.net","imageURL":"https://github.com/stephanbcbauer.png"}]},"prevItem":{"title":"Tractus-X Open Planning R24.08","permalink":"/blog/open-planning-r24-08"},"nextItem":{"title":"Tractus-X 23.12 available now","permalink":"/blog/new-release-2312"}},"content":"![eclipse tractus x logo](@site/static/img/Tractus-X_openplanning.png)\\n\\nDear Tractus-X Community Members \ud83c\udf89,\\n \\nWe are excited to extend this invitation to you for our upcoming Tractus-X meetings. These meetings are a great opportunity for both business stakeholders and developers to contribute and collaborate on the future of Tractus-X.\\nPlease feel free to forward this post to anyone interested in contributing, whether in planning or development.\\n \\n**Upcoming Meetings:**\\n \\n- **Tractus-X Guardrails**\\n  - Date: 13th December 2023\\n  - Time: 13:00 - 14:00\\n  - [Meetinglink](https://teams.microsoft.com/l/meetup-join/19%3ameeting_YWJmNzc2OWYtNWYwYy00MDhiLTgxODQtYjliZmQyMDRmMDY1%40thread.v2/0?context=%7b%22Tid%22%3a%221ad22c6d-2f08-4f05-a0ba-e17f6ce88380%22%2c%22Oid%22%3a%22a8b7a5ee-66ff-4695-afa2-08f893d8aaf6%22%7d)\\n- ~~**Tractus-X Open Refinement**~~ **meeting canceled**\\n  - ~~Date: 19th December 2023~~\\n  - ~~Time: 09:00 - 16:00~~\\n  - ~~[Meetinglink](https://teams.microsoft.com/l/meetup-join/19%3ameeting_ZDMzNmQwNzItYzJiZS00YmZhLWE0ZjctNDAzYmMwMjYyMTgw%40thread.v2/0?context=%7b%22Tid%22%3a%221ad22c6d-2f08-4f05-a0ba-e17f6ce88380%22%2c%22Oid%22%3a%22a8b7a5ee-66ff-4695-afa2-08f893d8aaf6%22%7d)~~\\n- **Tractus-X Open Refinement**\\n  - Date: 10th January 2024\\n  - Time: 09:00 - 16:00\\n  - [Meetinglink](https://teams.microsoft.com/l/meetup-join/19%3ameeting_NzAyMGQyN2ItYzJlZS00NTEwLTliMWItMjUyYjNjYzE1NWQ2%40thread.v2/0?context=%7b%22Tid%22%3a%221ad22c6d-2f08-4f05-a0ba-e17f6ce88380%22%2c%22Oid%22%3a%22a8b7a5ee-66ff-4695-afa2-08f893d8aaf6%22%7d)\\n- **Tractus-X Open Planning**\\n  - Date: 17th January 2024\\n  - Time: 09:30 - 16:30\\n  - [Meetinglink](https://teams.microsoft.com/l/meetup-join/19%3ameeting_ZTA5ZGFkMWQtNGY0NS00MWU1LTgxNGYtMjA5OWM3NmFkYjMx%40thread.v2/0?context=%7b%22Tid%22%3a%221ad22c6d-2f08-4f05-a0ba-e17f6ce88380%22%2c%22Oid%22%3a%22a8b7a5ee-66ff-4695-afa2-08f893d8aaf6%22%7d)\\n\\n\x3c!--truncate--\x3e\\n\\n## Staying Informed\\n \\nTo stay updated on any changes or additional information, please subscribe to our mailing list. A great way to keep informed is through the provided [Tractus-X Development Mailing List RSS Feed](https://www.eclipse.org/lists/tractusx-dev/maillist.rss).\\n\\n:::tip\\n\\nHere, you can also find previous messages for reference.\\n\\n:::\\n\\n## Feature Creation on SIG-Release Board\\n \\nAs with the last PI, you can already start creating features in the [SIG-Release board](https://github.com/orgs/eclipse-tractusx/projects/26). Please visit SIG-Release Board on GitHub to contribute.\\nThe only change this time is the label, which should now be `Prep-PI12`.\\n \\n## Further Information\\n \\nFor more details about the planning process and what these meetings entail, please refer to our guide on [Open Refinement and Planning in Open Source Communities](https://github.com/eclipse-tractusx/sig-release/blob/main/docs/Open-Refinement-and-Planning-in-Open-Source-Communities.md)\\n and of course the sig-release [README](https://github.com/eclipse-tractusx/sig-release/blob/main/README.md)\\n\\n## Stay Connected\\n\\nFollow our [news section](https://eclipse-tractusx.github.io/blog) and join our [Tractus-X mailing list](https://eclipse-tractusx.github.io/docs/oss/how-to-contribute/#dev-mailinglist)\\nand be part of our [Matrix Chat from Eclipse Tractus-X](https://chat.eclipse.org/#/room/#tools.tractus-x:matrix.eclipse.org) \\n\\nFor more details about Tractus-X, visit the official [Eclipse Tractus-X Project Page](https://projects.eclipse.org/projects/automotive.tractusx).\\n\\n---\\n\\nWe look forward to your participation and contributions in shaping the future of Tractus-X.\\n\\n\ud83d\ude80 **The Tractus-X Team**"},{"id":"new-release-2312","metadata":{"permalink":"/blog/new-release-2312","editUrl":"https://github.com/eclipse-tractusx/eclipse-tractusx.github.io/tree/main/blog/2023-12-08-release-23-12.md","source":"@site/blog/2023-12-08-release-23-12.md","title":"Tractus-X 23.12 available now","description":"Release Tractus-X 23.12 announcement","date":"2023-12-08T11:00:00.000Z","formattedDate":"December 8, 2023","tags":[],"readingTime":0.865,"hasTruncateMarker":false,"authors":[{"name":"Daniel Miehle","title":"Tractus-X Project Lead","url":"https://github.com/danielmiehle","image_url":"https://github.com/danielmiehle.png","email":"daniel.miehle@bmw.de","imageURL":"https://github.com/danielmiehle.png"}],"frontMatter":{"title":"Tractus-X 23.12 available now","description":"Release Tractus-X 23.12 announcement","slug":"new-release-2312","date":"2023-12-08T11:00","hide_table_of_contents":false,"authors":[{"name":"Daniel Miehle","title":"Tractus-X Project Lead","url":"https://github.com/danielmiehle","image_url":"https://github.com/danielmiehle.png","email":"daniel.miehle@bmw.de","imageURL":"https://github.com/danielmiehle.png"}]},"prevItem":{"title":"Open Source Planning for Tractus-X release 24.05","permalink":"/blog/open-planning-days-pi12"},"nextItem":{"title":"Launch of Our New Tutorial Section & First E2E Adopter Journey Tutorial","permalink":"/blog/release-tutorials"}},"content":"![Release Image](@site/static/img/Tractus-X_Release23-12.png)\\n\\nWe are pleased to announce the Tractus-X Release 23.12! This release brings important improvements to our Catena-X operating system and KITs in terms of robustness, documentation, and usability (e.g. enhanced error handling) for all data space participants.\\n \\nCatena-X Operating System (cxOS):\\nWe have significantly improved the performance, deployability, and the automation of our test approach of our core and enablement services. We realized our vision of multi-operating-company scenarios by fully enabling the Onboarding Service Provider Role, which allows various companies to perform the registration process now. \\n \\nUse Cases & Value Creation:\\nWith five new use case KITs and the Knowledge Agent KIT, we are introducing exciting new offerings to solve the toughest industry problems such as Demand and Capacity Management and Circular Economy together. The Knowledge Agent KIT provides a new compute-to-data approach, that is already implemented in the Remaining Useful Life KIT.\\n \\nData Space Governance:\\nThe Catena-X Automotive Network e.V. will provide the corresponding standards (\uf0e0 https://catena-x.net/de/standard-library) as well as 101 pager describing Catena-X in an easy way (\uf0e0 https://catena-x.net/de/library)."},{"id":"release-tutorials","metadata":{"permalink":"/blog/release-tutorials","editUrl":"https://github.com/eclipse-tractusx/eclipse-tractusx.github.io/tree/main/blog/2023-11-22-release_tutorials.mdx","source":"@site/blog/2023-11-22-release_tutorials.mdx","title":"Launch of Our New Tutorial Section & First E2E Adopter Journey Tutorial","description":"The Eclipse Tractus-X tutorials - Enhancing learning and development within our community","date":"2023-11-28T09:00:00.000Z","formattedDate":"November 28, 2023","tags":[],"readingTime":1.93,"hasTruncateMarker":true,"authors":[{"name":"Stephan Bauer","title":"Platform Domain Manager","url":"https://github.com/stephanbcbauer","image_url":"https://github.com/stephanbcbauer.png","email":"stephan.bauer@catena-x.net","imageURL":"https://github.com/stephanbcbauer.png"}],"frontMatter":{"title":"Launch of Our New Tutorial Section & First E2E Adopter Journey Tutorial","description":"The Eclipse Tractus-X tutorials - Enhancing learning and development within our community","slug":"release-tutorials","date":"2023-11-28T09:00","hide_table_of_contents":false,"authors":[{"name":"Stephan Bauer","title":"Platform Domain Manager","url":"https://github.com/stephanbcbauer","image_url":"https://github.com/stephanbcbauer.png","email":"stephan.bauer@catena-x.net","imageURL":"https://github.com/stephanbcbauer.png"}]},"prevItem":{"title":"Tractus-X 23.12 available now","permalink":"/blog/new-release-2312"},"nextItem":{"title":"Open Source Planning for Tractus-X","permalink":"/blog/open-planning-days"}},"content":"![eclipse tractus x logo](@site/static/img/TractusX-Tutorials_E2E.png)\\n\\nThe Tractus-X open source community is pleased to announce the introduction of a new tutorial section, including our inaugural End-to-End (E2E) Adopter Journey Tutorial.\\n\\n## Overview of the New Tutorial Section\\n\\nThis new section aims to provide structured and detailed educational content for our community members. The initiative reflects our commitment to supporting the continuous learning and development of our users and contributors.\\n\\n\x3c!--truncate--\x3e\\n\\n## Details of the First E2E Adopter Journey Tutorial\\n\\nThis tutorial is built for employees of the IT department who operates the IT stack of an adopter (data provider/consumer). It shows how to operate the various Tractus-X components in combination with each other.\\nIt also explains the basic connection with the core services (e.g. Keycloak and MIW), as provided by an operating company.\\n\\n![Five steps to gain value](@site/static/img/five_steps_to_gain_value.drawio.svg)\\n\\n:::info\\n\\nThe red marked steps are already included in the tutorial. The other steps will be added in the future.\\n\\n:::\\n\\n- **Features:** It includes a practical component where users can set up and interact with a locally deployed dataspace.\\n- **Target Audience:** The tutorial caters to both new users seeking an introduction to Tractus-X and existing members looking to deepen their understanding.\\n\\n### Feedback and Discussion\\n\\nWe encourage users to provide feedback after completing the tutorial. Constructive comments and suggestions can be submitted via our [discussions page](https://github.com/eclipse-tractusx/eclipse-tractusx.github.io/discussions). This feedback is essential for us to improve and tailor future educational content to the needs of our community.\\n\\n:::note\\n\\nPlease dont forget to add the label `documentation` to your discussion.\\n\\n:::\\n\\n### Accessing the Tutorial\\n\\nThe E2E Adopter Journey Tutorial is now available and can be accessed through the [Tractus-X tutorial section](https://eclipse-tractusx.github.io/docs/tutorials). We invite our community members to engage with this new resource and enhance their understanding of the Tractus-X ecosystem.\\n\\n## Future Developments\\n\\nThe launch of this tutorial marks the beginning of a series of educational resources we plan to release. Stay informed about future updates and additions to our tutorial section. Or even better, provide your own ideas and contributions.\\n\\nFor further information and to access the tutorial, please visit the [Tractus-X tutorial section](https://eclipse-tractusx.github.io/docs/tutorials).\\n\\n## Stay Connected\\n\\nFollow our [news section](https://eclipse-tractusx.github.io/blog) and join our [Tractus-X mailing list](https://eclipse-tractusx.github.io/docs/oss/how-to-contribute/#dev-mailinglist)\\nand be part of our [Matrix Chat from Eclipse Tractus-X](https://chat.eclipse.org/#/room/#tools.tractus-x:matrix.eclipse.org)\\n\\nFor more details about Tractus-X, visit the official [Eclipse Tractus-X Project Page](https://projects.eclipse.org/projects/automotive.tractusx)."},{"id":"open-planning-days","metadata":{"permalink":"/blog/open-planning-days","editUrl":"https://github.com/eclipse-tractusx/eclipse-tractusx.github.io/tree/main/blog/2023-10-26-open-planning.mdx","source":"@site/blog/2023-10-26-open-planning.mdx","title":"Open Source Planning for Tractus-X","description":"The Eclipse Tractus-X Open Planning Days - Empowering the Catena-X Data Space","date":"2023-10-04T11:00:00.000Z","formattedDate":"October 4, 2023","tags":[],"readingTime":6.13,"hasTruncateMarker":true,"authors":[{"name":"Stephan Bauer","title":"Plattform Domain Manager","url":"https://github.com/stephanbcbauer","image_url":"https://github.com/stephanbcbauer.png","email":"stephan.bauer@catena-x.net","imageURL":"https://github.com/stephanbcbauer.png"}],"frontMatter":{"title":"Open Source Planning for Tractus-X","description":"The Eclipse Tractus-X Open Planning Days - Empowering the Catena-X Data Space","slug":"open-planning-days","date":"2023-10-04T11:00","hide_table_of_contents":false,"authors":[{"name":"Stephan Bauer","title":"Plattform Domain Manager","url":"https://github.com/stephanbcbauer","image_url":"https://github.com/stephanbcbauer.png","email":"stephan.bauer@catena-x.net","imageURL":"https://github.com/stephanbcbauer.png"}]},"prevItem":{"title":"Launch of Our New Tutorial Section & First E2E Adopter Journey Tutorial","permalink":"/blog/release-tutorials"},"nextItem":{"title":"First Eclipse Tractus-X Community Days","permalink":"/blog/community-days"}},"content":"import RenderImage from \'./RenderImage\'\\n\\n![eclipse tractus x logo](@site/static/img/Eclipse-TractusX-Open-Planning-10-23.png)\\n\\nHello Open Source Enthusiasts! \ud83c\udf89\\n\\nthe Catena-X open-source reference implementations are currently mainly driven by the Catena-X consortium. We want to open-up the software development step by step and therefore warmly invite you to shape and contribute to this reference implementation!\\n\\nTo get more transparency about the status and product roadmaps of our reference implementations, we will conduct refinement and planning meetings in the Tractus-X open-source community.\\n\\nWe\'re thrilled to announce our upcoming planning sessions for **Tractus-X**:\\n- Open Refinementsession on 19.10.2023\\n- Open Planning/Review Session on 25.10.2023\\n\\n**Here\'s your chance to be part of an exciting journey from the ground up.**\\n\\n\x3c!--truncate--\x3e\\n\\n### Disclaimer\\n\\nIn the current Catena-X consortium, the various product teams have significantly shaped and defined the Catena-X data space including business use cases,\\nnetwork services, and the architecture and have released tangible results such as standards, KITs and open-source reference implementations. The results are now to be handed over to the Catena-X association.\\n\\nWith the transition to an association, a new working model including (open) refinement and (open) plannings for PI11 must be implemented in order to further develop these results and to carry out the knowledge\\ntransfer step by step by joint teams consisting of new association members and experienced consortium members under the governance of the Catena-X association.\\n\\nThe open planning days are the first step in this direction, but not all products are ready right now for an open planning. It might be the case, that some of the features are still defined within the jira, which is provided by the consortia.\\nIn this case not all of the participants can access the features with jira.\\n\\n_Please note_ In case there is a need to update an issue (e.g. adapt the description or link a subissue as a tasklist) committer rights are needed, or the initial creator of the issue has to do the changes.\\n\\nThese first alignment sessions will not be an introductory session - you should already be familiar with the source code of the service. We will introduce other formats to make sure you get onboarded and your voice is heard if you are new. We appreciate your understanding!\\nOur committers would highly appreciate contributions as a continuous stream of smaller, more manageable changes, rather than a big all-is-done chunk at the end of development. Thank you!\\n\\n### Why Should You Attend?\\n\\n- **Share your planned contributions** and discuss them openly with contributers, fellow developers and reference solution product owners.\\n- **Collaborate** with fellow developers and tech enthusiasts.\\n- **Inform** yourself about the latest developments in the open-source community.\\n- **Share** your expertise and insights to shape the future of Tractus-X.\\n- **Learn** about the core objectives and see how you can contribute.\\n- **Connect** with the Tractus-X community and build your network.\\n\\n### Some links to get you started\\n\\n- Getting started with [Eclipse Tractus-X](https://stephanbcbauer.github.io/eclipse-tractusx.github.io/docs/oss/getting-started)\\n- [Eclipse Tractus-X **GitHub** getting started](https://github.com/eclipse-tractusx/sig-release/wiki/Eclipse-Tractus-X-GitHub-getting-started)\\n- [Planning](https://github.com/eclipse-tractusx/sig-release/blob/main/README.md) with the sig-release repositorry\\n- Feature [planning board](https://github.com/orgs/eclipse-tractusx/projects/26) (without product filter)\\n- Current available [labels](https://github.com/eclipse-tractusx/sig-release/labels)\\n- [Matrix Chat from Eclipse Tractus-X](https://chat.eclipse.org/#/room/#tools.tractus-x:matrix.eclipse.org) and [getting-started](https://chat.eclipse.org/docs/getting-started/)\\n- [sig-release planning board](https://github.com/orgs/eclipse-tractusx/projects/26) and created features on [sig-release repository](https://github.com/eclipse-tractusx/sig-release/issues)\\n\\n### Open Refinement Session on 19.10.2023\\n\\nJoin us for our **Open Refinement Session**, where we\'ll embark on a high-level exploration of our project\'s features and outstanding issues. This session offers a platform for developers, stakeholders, and enthusiasts\\nto come together and clarify project requirements in **dediacted breakoutsessions**. It\'s an opportunity to ask questions and ensure everyone has a shared understanding of the project\'s direction.\\n\\nBy participating, you\'ll not only contribute to a smoother development process but also help in shaping the project\'s roadmap.\\n\\n**Be aware to refine your features within the sig-release repository ( on a high level until 17.10.2023 EOB ) and the related subtasks/issues in your product repository.**\\n\\n#### Introduction and Overview\\n\u23f0 **09:00 AM - 09:30 AM**\\n- [Sessionlink](https://teams.microsoft.com/l/meetup-join/19%3ameeting_ZTRjNGYwOWEtNGFiOC00YTM3LWFmNmMtODA3MmQzYzM1ZWNk%40thread.v2/0?context=%7b%22Tid%22%3a%221ad22c6d-2f08-4f05-a0ba-e17f6ce88380%22%2c%22Oid%22%3a%22a8b7a5ee-66ff-4695-afa2-08f893d8aaf6%22%7d)\\n- Welcome note by the consortia PMs and Tractus-X Team Lead.\\n- Brief overview of Tractus-X\'s mission and vision.\\n\\n#### Breakoutsessions\\n\u23f0 **09:30 AM - 12:30 PM**\\n\\nTeam/Topic | Presenter | Consortium representative | Issues | Sessionlink\\n--- | --- | --- | --- | ---\\nPortal & Marketplaces | all contributer | Julia Jeroch | [Issues] | [Sessionlink](https://teams.microsoft.com/l/meetup-join/19%3ameeting_MDA0YWZiMDAtNGQyZS00NGI0LTkxNzAtNDcyNjlkYzYyMWFh%40thread.v2/0?context=%7b%22Tid%22%3a%221ad22c6d-2f08-4f05-a0ba-e17f6ce88380%22%2c%22Oid%22%3a%22a8b7a5ee-66ff-4695-afa2-08f893d8aaf6%22%7d)\\nTractus-X EDC | all contributer | Stefan Ettl | [Issues] | [Sessionlink](https://teams.microsoft.com/l/meetup-join/19%3ameeting_YzAyNTQ1NmYtZjU4ZC00YjhiLTljNTktOTJlODEwNTYxMTNm%40thread.v2/0?context=%7b%22Tid%22%3a%221ad22c6d-2f08-4f05-a0ba-e17f6ce88380%22%2c%22Oid%22%3a%22a8b7a5ee-66ff-4695-afa2-08f893d8aaf6%22%7d)\\nManaged Identity Wallet | all contributer | Oliver Schlienz | [Issues] | [Sessionlink](https://teams.microsoft.com/l/meetup-join/19%3ameeting_YjIwY2EyMzYtODc1Ni00NzdhLTk5ZWQtNDhlN2VhMjM4MGUx%40thread.v2/0?context=%7b%22Tid%22%3a%221ad22c6d-2f08-4f05-a0ba-e17f6ce88380%22%2c%22Oid%22%3a%22a8b7a5ee-66ff-4695-afa2-08f893d8aaf6%22%7d)\\nIRS | all contributer | Johannes Zahn | [Issues] | [Sessionlink](https://teams.microsoft.com/l/meetup-join/19%3ameeting_NDkwNjAyNDAtOGJiNy00ZDIxLThmMmItNTc1M2JmNmNhMGRk%40thread.v2/0?context=%7b%22Tid%22%3a%221ad22c6d-2f08-4f05-a0ba-e17f6ce88380%22%2c%22Oid%22%3a%22a8b7a5ee-66ff-4695-afa2-08f893d8aaf6%22%7d)\\nBPN & Discovery Finder| all contributer | Thomas Henn | [Issues] | [Sessionlink](https://teams.microsoft.com/l/meetup-join/19%3ameeting_NWJlNThhZTgtOTA1OS00M2YxLTk2YzctMDNmNTAxYjA4ZmM5%40thread.v2/0?context=%7b%22Tid%22%3a%221ad22c6d-2f08-4f05-a0ba-e17f6ce88380%22%2c%22Oid%22%3a%22a8b7a5ee-66ff-4695-afa2-08f893d8aaf6%22%7d)\\nKnowledge Agent | all contributer | Tom Buchert | [Issues] | [Sessionlink](https://teams.microsoft.com/l/meetup-join/19%3ameeting_YTUyOTZmMzgtZDExMy00YmFiLWE0MDgtZDAwOGY4OWRhMDA1%40thread.v2/0?context=%7b%22Tid%22%3a%221ad22c6d-2f08-4f05-a0ba-e17f6ce88380%22%2c%22Oid%22%3a%22a8b7a5ee-66ff-4695-afa2-08f893d8aaf6%22%7d)\\nBPDM and Country Risk | all contributer | Benjamin Renn / Philipp Butzmann | [Issues] | [Sessionlink](https://teams.microsoft.com/l/meetup-join/19%3ameeting_MDk5NGEzZTItMzhkMC00Zjk2LTg4OTktMTdmODg1M2RlYjhm%40thread.v2/0?context=%7b%22Tid%22%3a%221ad22c6d-2f08-4f05-a0ba-e17f6ce88380%22%2c%22Oid%22%3a%22a8b7a5ee-66ff-4695-afa2-08f893d8aaf6%22%7d)\\n\\n#### Concluding Remarks and Open Floor\\n\u23f0 **12:30 PM - 01:00 PM**\\n- [Sessionlink](https://teams.microsoft.com/l/meetup-join/19%3ameeting_ZTc3YmI1YjQtOGY5ZC00MDI3LWE0YzctNjc1NmNhNTM5ODNl%40thread.v2/0?context=%7b%22Tid%22%3a%221ad22c6d-2f08-4f05-a0ba-e17f6ce88380%22%2c%22Oid%22%3a%22a8b7a5ee-66ff-4695-afa2-08f893d8aaf6%22%7d)\\n- Recap of all products and key takeaways\\n- Community Q&A\\n- Closing note and the next steps for Tractus-X\\n\\n### Open Planning/Review Session on 25.10.2023\\n\\nJoin us for our **Open Planning Session**, where we would like to focus on the features which have been planned / committed for the next release.\\n\\nWe\'ll collaboratively prioritize features, set clear milestones, and match tasks with the right talents and teams. More than just an organizational meeting, this is a space for dialogue, a chance for all contributors to weigh\\nin on our strategic approach.\\n\\nWhether you\'re a core developer, a stakeholder, or someone passionate about our mission, your insights are vital to make informed decisions. Let\'s shape our vision into a structured, actionable plan together!\\n\\n#### Introduction and Vision\\n\u23f0 **9:30 AM - 10:30 AM**\\n- [Sessionlink](https://teams.microsoft.com/l/meetup-join/19%3ameeting_OTMwOWU4MzItY2NmNS00YzllLTkyMzctZGZjMzI5YmUzZTdl%40thread.v2/0?context=%7b%22Tid%22%3a%221ad22c6d-2f08-4f05-a0ba-e17f6ce88380%22%2c%22Oid%22%3a%22a8b7a5ee-66ff-4695-afa2-08f893d8aaf6%22%7d)\\n- Welcome note by the consortia PMs and Tractus-X Team Lead.\\n- Brief overview of Tractus-X\'s mission and vision.\\n\\n#### Review/Planning Sessions\\n\u23f0 **10:30 AM - 05:15 PM**\\n- [Sessionlink](https://teams.microsoft.com/l/meetup-join/19%3ameeting_M2U1OGRhY2MtN2I4OC00ZjdmLTk5ZTgtYmNlNmEwZTFkMzk0%40thread.v2/0?context=%7b%22Tid%22%3a%221ad22c6d-2f08-4f05-a0ba-e17f6ce88380%22%2c%22Oid%22%3a%22a8b7a5ee-66ff-4695-afa2-08f893d8aaf6%22%7d)\\n\\nTimeline | Team/Topic | Presenter | Consortium representative | Issues\\n--- | --- | --- | --- | ---\\n10:30 AM - 11:15 AM | Portal & Marketplaces | all contributer | Julia Jeroch | [Issues]\\n11:15 AM - 12:00 PM | Tractus-X EDC | all contributer | Stefan Ettl | [Issues]\\n12:00 PM - 01:00 PM | Lunch Break | - | - | -\\n01:00 PM - 01:45 PM | Managed Identity Wallet | all contributer | Oliver Schlienz | [Issues]\\n01:45 PM - 02:30 PM | IRS | all contributer | Johannes Zahn | [Issues]\\n02:30 PM - 02:45 PM | Short Break | - | - | -\\n02:45 PM - 03:30 PM | BPN & Discovery Finder | all contributer | Thomas Henn | [Issues]\\n03:30 PM - 04:15 PM | Knowledge Agent | all contributer | Tom Buchert | [Issues]\\n04:15 PM - 04:30 PM | Short Break | - | - | -\\n04:30 PM - 05:15 PM | BPDM and Country Risk | all contributer | Benjamin Renn / Philipp Butzmann | [Issues]\\n\\n#### Concluding Remarks and Open Floor\\n\u23f0 **05:15 PM - 05:45 PM**\\n- [Sessionlink](https://teams.microsoft.com/l/meetup-join/19%3ameeting_YjMwNDRhMzctZjRkMC00ZWNlLTgzN2UtNTk0NmVmOTQzNDNj%40thread.v2/0?context=%7b%22Tid%22%3a%221ad22c6d-2f08-4f05-a0ba-e17f6ce88380%22%2c%22Oid%22%3a%22a8b7a5ee-66ff-4695-afa2-08f893d8aaf6%22%7d)\\n- Recap of all products and key takeaways\\n- Community Q&A\\n- Closing note and the next steps for Tractus-X\\n\\n## Stay Connected\\n\\nFollow our [news section](https://eclipse-tractusx.github.io/blog) and join our [Tractus-X mailing list](https://eclipse-tractusx.github.io/docs/oss/how-to-contribute/#dev-mailinglist)\\nand be part of our [Matrix Chat from Eclipse Tractus-X](https://chat.eclipse.org/#/room/#tools.tractus-x:matrix.eclipse.org) \\n\\nFor more details about Tractus-X, visit the official [Eclipse Tractus-X Project Page](https://projects.eclipse.org/projects/automotive.tractusx).\\n\\n---\\n\\nLooking forward to planning, coding, and succeeding together! \\n\\n\ud83d\ude80 **The Tractus-X Team**"},{"id":"community-days","metadata":{"permalink":"/blog/community-days","editUrl":"https://github.com/eclipse-tractusx/eclipse-tractusx.github.io/tree/main/blog/2023-09-20-community-days.mdx","source":"@site/blog/2023-09-20-community-days.mdx","title":"First Eclipse Tractus-X Community Days","description":"The Eclipse Tractus-X Community Days - Empowering the Catena-X Data Space","date":"2023-09-20T11:00:00.000Z","formattedDate":"September 20, 2023","tags":[],"readingTime":2.28,"hasTruncateMarker":true,"authors":[{"name":"Daniel Miehle","title":"Tractus-X Project Lead","url":"https://github.com/danielmiehle","image_url":"https://github.com/danielmiehle.png","email":"daniel.miehle@bmw.de","imageURL":"https://github.com/danielmiehle.png"}],"frontMatter":{"title":"First Eclipse Tractus-X Community Days","description":"The Eclipse Tractus-X Community Days - Empowering the Catena-X Data Space","slug":"community-days","date":"2023-09-20T11:00","hide_table_of_contents":false,"authors":[{"name":"Daniel Miehle","title":"Tractus-X Project Lead","url":"https://github.com/danielmiehle","image_url":"https://github.com/danielmiehle.png","email":"daniel.miehle@bmw.de","imageURL":"https://github.com/danielmiehle.png"}]},"prevItem":{"title":"Open Source Planning for Tractus-X","permalink":"/blog/open-planning-days"},"nextItem":{"title":"Tractus-X 23.09 available now","permalink":"/blog/new-release-23.09"}},"content":"import RenderImage from \'./RenderImage\'\\n\\n![eclipse tractus x logo](@site/static/img/Eclipse-TractusX-CommunityDays_Event2.png)\\n\\nDear Tractus-X-Community, dear All, \\nbeing interested in Catena-X and the open source reference implementations, KITs and open core products in the Tractus-X project or in general in the technology of data sovereign data exchange,\\n\\n**We are pleased to announce the First Eclipse Tractus-X Community Days, which will take place on December 7th and 8th at ARENA2036 in Stuttgart.**\\n\\n\x3c!--truncate--\x3e\\n\\n### Worth being there\\nAt this networking and coding event at ARENA2036, we offer you the opportunity to come together live with the developer community and actively code with our Tractus-X IT tools (KITs) for the Eclipse Tractus-X project and exchange ideas with our technical experts. Gain deep insights into the Catena-X architecture and actively contribute your ideas to practical participation opportunities (use cases, KITs, services).\\n\\n### What awaits you \\nThe agenda includes short keynote speeches with highly interesting technical insights, deep dives for a practical introduction to open-source programming topics and IT tools (our Open-Source Tractus-X KITs) and, above all, workshops in which you can become active and code yourself. You can bring your own challenges (please coordinate with us beforehand). At the evening event on the first day you can network, talk shop, code until late into the night - and of course just have fun. \\n\\n<RenderImage />\\n\\n\\n### Who meets here \\n- Developers who use Tractus-X or want to participate.\\n- Service or solution providers who want to participate in the Catena-X ecosystem. \\n- Data providers who want to provide data in the right format and with the right semantics.\\n- Those responsible for the planning and development of products (product owners or product managers) who want to learn how projects are planned in open source.\\n\\nYou belong to one of the above, then you are exactly right here. With the support of experts and in exchange with like-minded people, you can actively test the possibilities of Tractus-X and the Catena-X KITs. But of course, other technology-loving participants with an interest in sovereign data exchange are also welcomed.\\n\\n### How you can participate\\nIf you would like to join, please register for free via Eventbrite:\\n[Tractus-X Community Days registration](https://www.eventbrite.com/e/first-eclipse-tractus-x-community-days-tickets-721974885317?aff=oddtdtcreator). The number of places is limited, so it is worth being quick!\\n\\n### Contact\\nIf you have any questions about the event, please contact heike.wohlfeld@arena2036.de. \\n\\n**Get to know the developer community live and network with like-minded people - we look forward to your creativity and contributions! \\nYour Tractus-X Team**\\n\\n### Presenters of the event\\nThis is an Eclipse Tractus-X event, which takes place within the framework of the Catena-X Automotive Network consortium project (funding code: 13IK004*) and the Catena-X Automotive Network e.V.. ARENA2036 will host the event on its premises and contribute its data space activities (ARENA-X)."},{"id":"new-release-23.09","metadata":{"permalink":"/blog/new-release-23.09","editUrl":"https://github.com/eclipse-tractusx/eclipse-tractusx.github.io/tree/main/blog/2023-09-08-release-23.09.md","source":"@site/blog/2023-09-08-release-23.09.md","title":"Tractus-X 23.09 available now","description":"Release Tractus-X 23.09 announcement","date":"2023-09-08T11:00:00.000Z","formattedDate":"September 8, 2023","tags":[],"readingTime":0.87,"hasTruncateMarker":true,"authors":[{"name":"Daniel Miehle","title":"Tractus-X Project Lead","url":"https://github.com/danielmiehle","image_url":"https://github.com/danielmiehle.png","email":"daniel.miehle@bmw.de","imageURL":"https://github.com/danielmiehle.png"}],"frontMatter":{"title":"Tractus-X 23.09 available now","description":"Release Tractus-X 23.09 announcement","slug":"new-release-23.09","date":"2023-09-08T11:00","hide_table_of_contents":false,"authors":[{"name":"Daniel Miehle","title":"Tractus-X Project Lead","url":"https://github.com/danielmiehle","image_url":"https://github.com/danielmiehle.png","email":"daniel.miehle@bmw.de","imageURL":"https://github.com/danielmiehle.png"}]},"prevItem":{"title":"First Eclipse Tractus-X Community Days","permalink":"/blog/community-days"},"nextItem":{"title":"Tractus-X 3.1 available now","permalink":"/blog/new-release-3-1-0"}},"content":"![eclipse tractus x logo](@site/static/img/release_23.09.png)\\n\\nWe are pleased to announce the [Tractus-X Release 23.09!](https://github.com/eclipse-tractusx/tractus-x-release/releases/tag/23.09) This release brings important improvements to our Catena-X operating system and KITs in terms of robustness, data sovereignty, compliance, and overall user experience for all data space participants.\\n\\n\x3c!--truncate--\x3e\\n\\n### Catena-X Operating System (cxOS):\\n\\nWe are introducing a decentralized registry for digital twins and a managed identity wallet based on self-sovereign identities to **maximize sovereignty** of all data space participants. In addition, we offer the first ever integration with a Gaia-X Digital Clearing House (GXDCH) to foster **trust** and **data space interoperability**.\\n\\n\\n![eclipse tractus x logo](@site/static/img/release_23.09_cx_os.png)\\n\\n\x3c!--truncate--\x3e\\n\\n### Use Cases & Value Creation:\\n\\nWith **six new KITs**, we are introducing exciting new offerings and standards for our solution providers and data providers to **build a multi-vendor ecosystem** of applications and services.\\n\\n\\n\x3c!--truncate--\x3e\\n\\n\\n### Data Space Governance:\\n\\nThe [Catena-X Automotive Network e.V.](https://catena-x.net/en/) will introduce significant advancements in the governance framework for data space operations by providing the **flight level model** and new **use case policies** by end of the of the month."},{"id":"new-release-3-1-0","metadata":{"permalink":"/blog/new-release-3-1-0","editUrl":"https://github.com/eclipse-tractusx/eclipse-tractusx.github.io/tree/main/blog/2023-05-26-release-3-1-0.md","source":"@site/blog/2023-05-26-release-3-1-0.md","title":"Tractus-X 3.1 available now","description":"Release Tractus-X 3.1.0 announcement","date":"2023-05-26T11:00:00.000Z","formattedDate":"May 26, 2023","tags":[],"readingTime":0.405,"hasTruncateMarker":true,"authors":[{"name":"Daniel Miehle","title":"Tractus-X Project Lead","url":"https://github.com/danielmiehle","image_url":"https://github.com/danielmiehle.png","email":"daniel.miehle@bmw.de","imageURL":"https://github.com/danielmiehle.png"}],"frontMatter":{"title":"Tractus-X 3.1 available now","description":"Release Tractus-X 3.1.0 announcement","slug":"new-release-3-1-0","date":"2023-05-26T11:00","hide_table_of_contents":false,"authors":[{"name":"Daniel Miehle","title":"Tractus-X Project Lead","url":"https://github.com/danielmiehle","image_url":"https://github.com/danielmiehle.png","email":"daniel.miehle@bmw.de","imageURL":"https://github.com/danielmiehle.png"}]},"prevItem":{"title":"Tractus-X 23.09 available now","permalink":"/blog/new-release-23.09"},"nextItem":{"title":"Eclipse Tractus-X Developer Portal is LIVE!","permalink":"/blog/portal-is-live"}},"content":"We are pleased to announce the release of [Tractus-X 3.1!](https://eclipse-tractusx.github.io/CHANGELOG/#310---2023-05-17) This release brings important improvements to the robustness, quality, and overall user experience of the Catena-X data space. In addition, we introduce exciting new offerings for our solution providers such as the Traceability KIT and the Country Risk Service.\\n\\n\x3c!--truncate--\x3e\\n\\nWith version 3.1, the Catena-X Association also introduces significant advancements in data sovereignty by providing the first version of the [Governance Framework](https://catena-x.net/en/catena-x-introduce-implement/governance-framework-for-data-space-operations) as well as [Policies for our use case Traceability](https://catena-x.net/fileadmin/user_upload/04_Einfuehren_und_umsetzen/Framework_Use_Case_Traceability/Catena-X_Use_Case_Policies_Trace_3.0_EN.pdf)."},{"id":"portal-is-live","metadata":{"permalink":"/blog/portal-is-live","editUrl":"https://github.com/eclipse-tractusx/eclipse-tractusx.github.io/tree/main/blog/2023-02-10-portal-is-live.md","source":"@site/blog/2023-02-10-portal-is-live.md","title":"Eclipse Tractus-X Developer Portal is LIVE!","description":"Official launch announcement","date":"2023-02-10T11:00:00.000Z","formattedDate":"February 10, 2023","tags":[],"readingTime":0.65,"hasTruncateMarker":true,"authors":[{"name":"Daniel Miehle","title":"Tractus-X Project Lead","url":"https://github.com/danielmiehle","image_url":"https://github.com/danielmiehle.png","email":"daniel.miehle@bmw.de","imageURL":"https://github.com/danielmiehle.png"}],"frontMatter":{"title":"Eclipse Tractus-X Developer Portal is LIVE!","description":"Official launch announcement","slug":"portal-is-live","date":"2023-02-10T11:00","hide_table_of_contents":false,"authors":[{"name":"Daniel Miehle","title":"Tractus-X Project Lead","url":"https://github.com/danielmiehle","image_url":"https://github.com/danielmiehle.png","email":"daniel.miehle@bmw.de","imageURL":"https://github.com/danielmiehle.png"}]},"prevItem":{"title":"Tractus-X 3.1 available now","permalink":"/blog/new-release-3-1-0"}},"content":"![eclipse tractus x logo](@site/static/img/logo-blog.png)\\n\\nWe are thrilled to announce the launch of the Developer Portal for the Eclipse Tractus-X project! This portal is designed to provide developers with an easy way to access all of our resources and documentation.\\n\\n\x3c!--truncate--\x3e\\n\\nWith this new portal, we aim to make it easier than ever before for developers around the world to get started building amazing projects on top of the Catena-X network. We have included our initial KITs and developer guides that will help you develop your solution. Step by step we will also provide a comprehensive overview of useful reference material.\\n\\nThe best part? All these resources are free and open-source! So what\u2019s stopping you from taking advantage right now? Let\u2019s get coding together and build something amazing with Tractus-X today!"}]}')}}]);